import React, { Component } from 'react';
import Message from './Message.js'

class MessageList extends Component {
  state ={
    messages: []
  }

  render() {
    return (
      <div>
        {(this.props) ? this.state.messages.map((message, i) => {return <Message starMessage={this.props.starMessage} key={i} id={message.id} subject={message.subject} read={message.read} starred={message.starred} labels={message.labels}/>}) : console.log(this.props.messages)}
      </div>
    )
  }

}
export default MessageList;
